import React, { Component } from "react";
import logo from '../img/logo-colored.png';

export default class  Picture extends Component {
    state = {};
    render() {
        return (
            <div className="logo-block" >
                <img src={logo} className="logo-style" alt="Logo"/>
                <div></div>
                <div></div>

            </div>

        ) 
    }
}
